window.bookSummaryJSON = "<p><b>The sons of Kenyan just take what they want and who they want. The combination of their wealth, influence, and hostility makes them a serious threat.</b></p> <p>When it comes to getting his hands on Gia, Dravin will literally do anything. He's after her, but he has a secret that no one outside the Order knows about. What will Gia do when she finds out? Give in to her desires, or be the sacrifice?</p> <p>Jess is fleeing from a dark past. Her inner demons may be dark, but they all have names. When she runs into members of the Order, they try to break her but they don't realize she is already broken. Reid and Valen are both dangerous, and sinful, and enjoy a challenge. They begin to feed on Jess's lust for desire.</p> <p>After one taste, they can't stop.</p> <p>Gia and her roommate Jess have realized they are Prey in a dangerous game of seduction.</p> <p>There is only one way out: play the game or change the rules.</p> <p>Lust <i>is book two from The Prey Series. You must listen to </i>Thirst <i>before listening to </i>Lust.<i> </i>Lust<i> is a gothic romance with multiple POVs.</i></p>"; 
